import { ListGroup } from "react-bootstrap";
function IServicesItem() {
  return (
  <center className="IServicesItem" >
    <ListGroup defaultActiveKey="#link1">
    <ListGroup.Item action href="#link1">
      Link 1
    </ListGroup.Item>
    <ListGroup.Item action href="#link1">
    <img src="img/a.jpeg" className="IServicesItemImg" />
    </ListGroup.Item>

  </ListGroup>
  </center>
  );
}
export default IServicesItem;
